import React from 'react';
import { Link, useLocation } from "react-router-dom";
import './Nav.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Nav = () => {

  let path = useLocation().pathname;
  console.log(path);
  let background;
  switch(path) {
    case "/nat":
      background = "#ffb457;";
      break;
    case "/cs":
      background = "#ff96bd;";
      break;
    case "/music":
      background ="#9999fb;";
      break;
    case "/comedy":
      background = "#42c0ff;";
      break;

  }

  return (
    <div className="nav">
      <nav>
        <ul className="tab-row">
            <li>
                <Link to="/nat" className="tab" id="tab1">
                  <FontAwesomeIcon icon="hand" />
                </Link>
            </li>
            <li>
                <Link to="/cs" className="tab" id="tab2">
                  <FontAwesomeIcon icon="computer" />
                </Link>
            </li>
            <li>
                <Link to="/music" className="tab" id="tab3">
                  <FontAwesomeIcon icon="music" />
                </Link>
            </li>
            <li>
                <Link to="/comedy" className="tab" id="tab4">
                  <FontAwesomeIcon icon="masks-theater" />
                </Link>
            </li>
        </ul>
      </nav>
    </div>

  )
}

export default Nav;
